import React, { useState } from "react";
import QuoteForm from "../components/QuoteForm";
import Navbar from "../components/Navbar";
import "../styles/AboutContactPage.css";

function AboutContactPage() {
  const [showForm, setShowForm] = useState(false);
  const [burgerOpen, setBurgerOpen] = useState(false);

  return (
    <div className="about-contact-page">
      {/* Header */}
      <header className="about-header">
        <div className="header-images">
          {/* Left: Wolf Logo */}
          <img
            src="/assets/logo/Wolf2.png"
            alt="Logo"
            className="wolf-logo"
            onClick={() => window.location.href = "/"}
          />

          {/* Center: Neon Title */}
          <div
            className="neon-title-container"
            onClick={() => window.location.href = "/"}
          >
            <h1 className="neon-title-line neon-title-h1">H&amp;A</h1>
            <h2 className="neon-title-line neon-title-h2">Appliances</h2>
          </div>

          {/* Right: Contact info + burger */}
          <div className="header-right">
            <div className="header-contact-info">
              <a href="tel:+19407641751" className="header-contact-item">
                ðŸ“ž +1 (940) 764-1751
              </a>
              <a href="mailto:Herculesmulder94@gmail.com" className="header-contact-item">
                ðŸ“§ Herculesmulder94@gmail.com
              </a>
            </div>
            <button
              className="burger-btn"
              onClick={() => setBurgerOpen(!burgerOpen)}
            >
              â˜°
            </button>
          </div>
        </div>

        {/* Navbar overlay */}
        {burgerOpen && (
          <div className="burger-menu-overlay">
            <Navbar onLinkClick={() => setBurgerOpen(false)} />
          </div>
        )}
      </header>

      {/* About Section */}
      <section className="about-section">
        <h2>About Cold Company</h2>
        <p>
          Cold Company is your trusted partner for refrigeration, cold rooms,
          aircon installations, and appliance parts. We provide high-quality
          products, expert advice, and outstanding service to keep your
          equipment running smoothly.
        </p>
      </section>

      {/* Contact Section */}
      <section className="contact-section">
        <h2>Contact Us</h2>
        <p>
          <strong>Email:</strong>{" "}
          <a href="mailto:Herculesmulder94@gmail.com">Herculesmulder94@gmail.com</a>
        </p>
        <p>
          <strong>Phone:</strong>{" "}
          <a href="tel:+19407641751">+1 (940) 764-1751</a>
        </p>
        <p>
          <strong>Address:</strong> 123 Cold Street, Pretoria, South Africa
        </p>
        <button
          className="contact-form-btn"
          onClick={() => setShowForm(true)}
        >
          Send a Message / Request Quote
        </button>
      </section>

      {/* Modal Form */}
      {showForm && (
        <div className="modal-overlay">
          <div className="modal-content">
            <button
              className="close-modal-btn"
              onClick={() => setShowForm(false)}
            >
              &times;
            </button>
            <QuoteForm onSuccess={() => setShowForm(false)} />
          </div>
        </div>
      )}

      {/* Footer */}
      <footer className="footer">
        <p>Â© {new Date().getFullYear()} Cold Company. All rights reserved.</p>
        <p>
          <strong>Email:</strong>{" "}
          <a href="mailto:info@H&Aappliances@gmail.com">info@H&Aappliances@gmail.com</a>{" "}
          /{" "}
          <a href="mailto:Herculesmulder94@gmail.com">Herculesmulder94@gmail.com</a>{" "}
          | <strong>Phone:</strong>{" "}
          <a href="tel:+27123456789">+27 12 345 6789</a>
        </p>
      </footer>
    </div>
  );
}

export default AboutContactPage;
